(8, 'Welcome back China Southern Airlines\r\n', 1, 'A good start in the very beginning of 2018, Aerofood ACS Unit in Jakarta is delivering its in-flight catering services to China Southern Airlines from Soekarno-Hatta airport start from 1st January 2018.Same in-flight catering services to China Southern Airlines is also done by Aerofood ACS Unit in Bali.Premium products and operational excellence with safety and security basis is the most important component in aviation industry which consistently maintain and improve by Aerofood ACS.\r\n', 1, 1, NULL, 1, '2018-01-04 08:13:24', '2018-01-04 08:13:24', 0),
