INSERT INTO `questions` (`id`, `id_test`, `question_text`, `url_file`, `created_at`, `updated_at`) VALUES
(1, 1, 'The deliverables that are not belong to design deliverables is...', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(2, 1, 'When the user requirements for a system are unclear, it is difficult to understand them by talking about them and explaining them with written reports.', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(3, 1, '... is a set of interrelated elements or components that collect (input), manipulate (process), and disseminate (output) data and information and provide a feedback mechanism to meet an objective.', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(4, 1, 'Waterfall methodologies of prototyping and throwaway prototyping are usually more appropriate when user requirements are unclear so they show the users a prototype to make sure the requirement meets to their needs and objective.', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(5, 1, 'The key person in the SDLC is the project manager, who analyzes the business situation, identifies opportunities for improvements, and designs an information system to implement them.', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(6, 1, 'Information System that support unstructured decision in decision making process is:', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(7, 1, 'The structural model does represent software components or classes in an object-oriented programming language.', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(8, 1, 'Implementation Process needs more effort allocation than Analysis Process because, in Implementation Process, organizations need a lot of people to implement the information system.', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(9, 1, 'Requirements gathering is one of the planning\'s steps in SDLC.', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(10, 1, 'Which one are the right steps for implementation phase in SDLC?', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(11, 1, 'Which the following specifications that are not covers on the design phases?', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(12, 1, 'Data-centered methodologies utilize data models as the core of the system concept.', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(13, 1, 'Concepts in the object-oriented approach enable analysts to break a complex system into smaller, more-manageable modules, work on the modules individually, and easily piece the modules back together to form an information system.', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(14, 1, 'Projects that have short time schedules are well suited for ? and ... because these methodologies are designed to increase the speed of development.', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(15, 1, 'Who is the key person that analyses the business, identify opportunities for improvement, and design an information systems to implement them?', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(16, 1, 'Below are the right steps in implementation process, except...', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(17, 1, 'What is the objective of information system?', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(18, 1, 'SDLC is a process of gradual refinement.', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(19, 1, 'Each phases in SDLC is composed of a series of steps, which rely upon techniques that not produce deliverables.', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(20, 1, 'Building an information system is similar to building a house. First, starts with a basic idea. Second, this idea is transformed into a simple drawing that is shown to the customer and refined until the customer agrees that the picture depicts what he or she wants. Third, a set of blueprints is designed that presents much more detailed information about the house. Finally, the house is built following the blueprints, often with some changes directed by the customer as the house is erected.', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
